/*
 Given an integer array nums, return an array answer such that answer[i] is equal to the product of all the elements of nums except nums[i].

The product of any prefix or suffix of nums is guaranteed to fit in a 32-bit integer.

You must write an algorithm that runs in O(n) time and without using the division operation.

Example 1:
Input: nums = [1,2,3,4]
Output: [24,12,8,6]

Example 2:
Input: nums = [-1,1,0,-3,3]
Output: [0,0,9,0,0]
 */

package leetcodeQuestions;

public class productOfArrayExceptSelf {

    public static int[] productExceptSelf(int []nums){
        int ans[]=new int[nums.length];
        int prev[]=new int[nums.length]; int next[]=new int[nums.length];

        for(int val=nums.length-1;val>=0;val-=1) {
             if(val<nums.length-1)
                next[val]=next[val+1]*nums[val];
             else next[val]=nums[val];}
        
        for(int i=0;i<nums.length;i+=1) {
            if(i>0)
            prev[i]=prev[i-1]*nums[i];
        else prev[i]=nums[i];}
        
        for(int i=0; i<nums.length;i+=1){
            if(i!=0&&i!=nums.length-1)
                ans[i]=prev[i-1]*next[i+1];
            else{
                if(i==0) ans[i]=next[i+1];
                else if(i==nums.length-1) ans[i]=prev[i-1];
            }
        }
        return ans;
    }
    public static void main(String[] args) {
        int nums[]={1,2,3,4};
        int res[]=productExceptSelf(nums);
        System.out.print("Res: ");
        for(int i:res)
        System.out.print(i+" ");
    }
}

